import React from 'react';
import '../styles/Galeria.css';

const Galeria = () => {
    return (
        <div className="galeria-container">
            <h1>Galer√≠a</h1>
            <div className="image-grid">
                <img src="URL_IMAGEN_1" alt="Hostal 1" />
                <img src="URL_IMAGEN_2" alt="Hostal 2" />
                <img src="URL_IMAGEN_3" alt="Hostal 3" />
                <img src="URL_IMAGEN_4" alt="Hostal 4" />
            </div>
        </div>
    );
};

export default Galeria;
